import Nav from 'react-bootstrap/Nav';

function PillsExample() {
  return (
    <Nav variant="pills" defaultActiveKey="/home" className="custom-nav">

      <Nav.Item>
        <Nav.Link href="/home">New Appointments</Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link eventKey="link-1">Suggested Appointments2</Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link href="/home">Confirmed Appointments</Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link href="/home">Canceled Appointments</Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link href="/home">Past Appointments</Nav.Link>
      </Nav.Item>

    </Nav>
  );
}

export default PillsExample;
